@221b_EHolmes His face turned a deep shade of crimson and he was clearly angry.

M: "If you will excuse me, Anthony, I have some... business to attend to."

He sent two telegrams before he left, one to the station saying he'd be there directly and one home to ascertain Cassidy's whereabouts.

